import 'dart:convert';
import 'dart:typed_data';

import 'package:flutter/material.dart';
import 'package:flutter_pdfjs_viewer/flutter_pdfjs_viewer.dart';

class PdfViewerPage extends StatefulWidget {
  const PdfViewerPage({super.key});

  @override
  State<PdfViewerPage> createState() => _PdfViewerPageState();
}

class _PdfViewerPageState extends State<PdfViewerPage> {
  final String base64PDF = ''; 
  @override
  Widget build(BuildContext context) {
    final Uint8List pdfData = Uint8List.fromList(base64.decode(base64PDF));
    return Scaffold(
      appBar: AppBar(title: const Text('Flutter PDF JS Demo'),),
      body: PDFJSViewerWidget.data(pdfData),
      // body: PDFJSViewerWidget.file(path),
      // body: PDFJSViewerWidget.network(path),
      // body: PDFJSViewerWidget.assets('assets/sample.pdf'),
    );
  }
}
